import React from "react";

const projects = [
  {
    title: "Portfolio Website",
    description: "A personal portfolio website to showcase my projects and skills.",
    link: "https://example.com",
  },
  {
    title: "E-commerce App",
    description: "An online store with product listings, a shopping cart, and payment integration.",
    link: "https://example.com",
  },
  {
    title: "Weather App",
    description: "A weather forecast app that displays real-time weather updates for any location.",
    link: "https://example.com",
  },
];

const Projects = () => (
  <div className="bg-[#f7f7f7] py-12 px-4">
    <h2 className="text-4xl font-bold text-center mb-8">My Projects</h2>
    <div className="flex flex-col gap-8 max-w-5xl mx-auto">
      {projects.map((project, index) => (
        <div
          key={index}
          className="p-6 bg-white shadow-md rounded-lg hover:shadow-lg transition-shadow duration-300"
        >
          <h3 className="text-2xl font-semibold">{project.title}</h3>
          <p className="text-gray-700 mt-2">{project.description}</p>
          <a
            href={project.link}
            target="_blank"
            rel="noopener noreferrer"
            className="text-blue-500 hover:text-blue-700 mt-4 inline-block"
          >
            View Project
          </a>
        </div>
      ))}
    </div>
  </div>
);

export default Projects;
